import { Container, Row, Col } from "react-bootstrap";
import { Film } from "./Film"

function FilmsContainer() {
  this.state = {
    list: []
  }

  fetch("localhost:8080/api/films/ranking/1")
    .then(response => response.json)
    .then(data => {
      this.setState({list: data})
    })
}

function FilmDiv() {
  return (
    <div className="dataDiv">
      {this.state.list.map(film => <Film data={film}/>)}    
    </div>
  )
}

function Films() {
    return (
      <Container fluid>
        <h1>Films</h1>
        <FilmDiv/>
      </Container>
    )
  }


export default Films;
